import { Component, Prop, Vue } from 'vue-property-decorator';
import Canvas from '../../../../src/draw';

@Component
export default class HelloWorld extends Vue {
  private canvas!: Canvas;
  private mounted() {
    this.canvas = new Canvas('canvas');
  }
}
